CREATE DEFINER=`root`@`localhost` PROCEDURE `CrearGrupoConMiembro` (IN `p_Nombre` VARCHAR(100), IN `p_Descripcion` VARCHAR(100), IN `p_CreadorID` INT, IN `p_ImagenBlob` BLOB)   BEGIN
    DECLARE v_GrupoID INT;
    
    -- Insertar el grupo en la tabla Grupo
    INSERT INTO Grupo (Nombre, Descripcion, Fecha_creacion, Creador_ID, ImagenBlop)
    VALUES (p_Nombre, p_Descripcion, NOW(), p_CreadorID, p_ImagenBlob);
    
    -- Obtener el ID del grupo recién insertado
    SET v_GrupoID = LAST_INSERT_ID();
    
    -- Insertar al usuario creador como miembro del grupo en la tabla MiembrosGrupo
    INSERT INTO MiembrosGrupo (UsuarioID, GrupoID, FechaUnion)
    VALUES (p_CreadorID, v_GrupoID, NOW());
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertarSubgrupo` (IN `nombreGrupo` VARCHAR(100), IN `grupoPrincipalID` INT, IN `descripcionSubgrupo` VARCHAR(100), IN `imagenSubgrupo` BLOB, IN `creadorID` INT)   BEGIN
    DECLARE fechaCreacion DATETIME;
    SET fechaCreacion = NOW();
    
    -- Insertar el subgrupo en la tabla Subgrupo
    INSERT INTO Subgrupo (Nombre, GrupoPrincipal_ID, Fecha_creacion, Descripcion, Imagen)
    VALUES (nombreGrupo, grupoPrincipalID, fechaCreacion, descripcionSubgrupo, imagenSubgrupo);
    
    -- Obtener el ID del nuevo subgrupo
    SELECT LAST_INSERT_ID() INTO @NuevoSubgrupoID;
    
    -- Insertar el creador del subgrupo en la tabla MiembrosSubgrupo
    INSERT INTO MiembrosSubgrupo (UsuarioID, SubgrupoID, FechaUnion)
    VALUES (creadorID, @NuevoSubgrupoID, fechaCreacion);
    
    SELECT @NuevoSubgrupoID AS NuevoSubgrupoID;
END$$

